SELECT tourist_attractions.name, tourist_attractions.description, tourist_attractions.how_to_get_there 
FROM tourist_attractions 
JOIN royal_family ON tourist_attractions.tourist_attraction_id = royal_family.royal_family_id;

SELECT order_items.product_id, COUNT(DISTINCT order_items.order_id) AS distinct_order_count
FROM order_items
GROUP BY order_items.product_id;

SELECT invoices.invoice_date, orders.order_id, orders.order_details 
FROM invoices 
JOIN orders ON invoices.order_id = orders.order_id;
